window.bookSummaryJSON = "<p><b>Brought to you by Penguin.</b></p> <p>Nobody remembers how the Causality War started. Really, there's no-one to remember and nothing for them to remember if there were; that's sort of the point. We were time warriors and we broke time.</p> <p>I was the one who ended it. Ended the fighting, tidied up the damage as much as I could.</p> <p>Then I came here, to the end of it all, and gave myself a mission: to never let it happen again.</p>"; 
